const cores = {
  corPrimaria: "#FBA31F", 
  corSecundaria: "#1111"
}
const Botao = (props) => {
  return (<button className={`whitespace-nowrap text-sm cursor-pointer underline underline-offset-2 hover:bg-${cores.corPrimaria}`}>
      {props.children} 
  </button>)
}

export default Botao
